import Container from "react-bootstrap/esm/Container";
import mySkills from "./MySkills";
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import SkillItem from './SkillItem';
import Card from 'react-bootstrap/Card';

Object.keys(mySkills).map((key) => {
    Object.keys(mySkills[key]).map((innerKey) => {
        console.log(`${key}: ${innerKey} : ${mySkills[key][innerKey]}`)
    })
    console.log('------------------')
})



function Skills() {

    


    return (

        <section className = 'myskills-section Poppins' id ='skills'>
            <Container fluid>

            <Col className ='myskills-header'>
                <h1>My Skills</h1>
            </Col>

            
            {
                Object.keys(mySkills).map((key) => {
                
                return <div>
                            
                            <div className = 'd-flex align-items-center skill-row mt-5 pt-5 mb-3'>
                                <img src = {`../images/Skills/${key}.png`} alt = '' height={256} width={256}  />
                                <h1 className = 'skill-header' style ={{marginLeft:'25px'}}>{key}</h1> 
                            </div>
                            <Row>
                            {Object.keys(mySkills[key]).map((innerKey) => {
                        return <Card className='m-3 '  style={{ width: '12rem',backgroundColor:'transparent',borderColor:'transparent',boxShadow:'0 4px 3px 0 rgba(0, 0, 0, 0.2), 0 6px 2px 0 rgba(0, 0, 0, 0.19)' }}>
                                <Card.Img variant="top" src={`../images/Skills/${innerKey}.png`} />
                                <Card.Body ><br /><br />
                                    <Card.Title className='text-center'>{innerKey}</Card.Title><br /><br />
                                    <Card.Text className='text-center'>
                                        <div className = 'text-center outer-progress-bar'>
                                            <div className = 'text-center inner-progress-bar' style = {{width: `${mySkills[key][innerKey]}%`}}> 
                                                <span>{mySkills[key][innerKey]}%</span>                  
                                            </div>
                                        </div>
                                    </Card.Text>
                                </Card.Body>
                                </Card>
                    })}
                            </Row>
                       


                    </div>
                        
                    
                })
                
            }

            
                   
                
            
            
            <br /><br /><br /><br /><br /><br /> <br /><br /><br /><br /><br /><br />
            </Container>
        </section>


    )



}

export default Skills;
